import '../src/App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="./public/assets/JoannSongLogo.png" width="500" height="500" alt="logo" />
        <a
          className="Main Page"
          href="/public/index.html"
        >
          Enter My Website
        </a>
      </header>
    </div>
  );
}

export default App;
